import React, {Component} from 'react';



class App extends Component{

  constructor(props){
    super(props);
    this.state = {
      cartList: []
    }
  }



  componentDidMount() {
     fetch("http://jsonplaceholder.typicode.com/todos").then(data => data.json()).then(data =>this.setState({cartList: data})).catch(console.log);
  }
  render() {
    return (
      <div className="container">
        <div className="col-xs-12">
        <h1>Your current Cart:</h1>
        {this.state.cartList.map((data) => (
          <div className = "data">
            <scope className = "row">
            <p className="elements">
             {data.name} {data.description} {data.completed} {data.userId}
            </p>
            </scope>
           </div> 
        ))}
        </div>
        </div>
    );
  }

}

export default App;
